syntax = "proto3";

package zproto;

import "stru_dirty_mask.proto";

message FishRecord {
    int32 fishId = 1;
    bool firstFlag = 2;
    int32 size = 3;
    int64 millisecond = 4;
    int32 research = 5;
    uint32 count = 6;
    int32 minSize = 7;
    int64 minSizemillisecond = 8;
    repeated zproto.FishRecord.StarCntsEntry starCnts = 9;
}
